export function getIconComponent(iconName:string, theme:string) {
    switch (iconName) {
        case "Apple":
            return theme === "dark" ? <AppleDark /> : <AppleLight />;
        case "Discord":
            return theme === "dark" ? <DiscordDark /> : <DiscordLight />;
        case "Facebook":
            return theme === "dark" ? <FacebookDark /> : <FacebookLight />;
        case "Github":
            return theme === "dark" ? <GithubDark /> : <GithubLight />;
        case "Instagram":
            return theme === "dark" ? <InstagramDark /> : <InstagramLight />;
        case "Medium":
            return theme === "dark" ? <MediumDark /> : <MediumLight />;
        case "Pinterest":
            return theme === "dark" ? <PinterestDark /> : <PinterestLight />;
        case "Signal":
            return theme === "dark" ? <SignalDark /> : <SignalLight />;
        case "Spotify":
            return theme === "dark" ? <SpotifyDark /> : <SpotifyLight />;
        case "Threads":
            return theme === "dark" ? <ThreadsDark /> : <ThreadsLight />;
        case "Tumblr":
            return theme === "dark" ? <TumblrDark /> : <TumblrLight />;
        case "VK":
            return theme === "dark" ? <VKDark /> : <VKLight />;
        case "Twitter":
            return theme === "dark" ? <TwitterDark /> : <TwitterLight />;
        case "Clubhouse":
            return theme === "dark" ? <ClubhouseDark /> : <ClubhouseLight />;
        case "Dribbble":
            return theme === "dark" ? <DribbbleDark /> : <DribbbleLight />;
        case "Figma":
            return theme === "dark" ? <FigmaDark /> : <FigmaLight />;
        case "Google":
            return theme === "dark" ? <GoogleDark /> : <GoogleLight />;
        case "LinkedIn":
            return theme === "dark" ? <LinkedInDark /> : <LinkedInLight />;
        case "Messenger":
            return theme === "dark" ? <MessengerDark /> : <MessengerLight />;
        case "Reddit":
            return theme === "dark" ? <RedditDark /> : <RedditLight />;
        case "Snapchat":
            return theme === "dark" ? <SnapchatDark /> : <SnapchatLight />;
        case "Telegram":
            return theme === "dark" ? <TelegramDark /> : <TelegramLight />;
        case "TikTok":
            return theme === "dark" ? <TikTokDark /> : <TikTokLight />;
        case "Twitch":
            return theme === "dark" ? <TwitchDark /> : <TwitchLight />;
        case "WhatsApp":
            return theme === "dark" ? <WhatsAppDark /> : <WhatsAppLight />;
        case "YouTube":
            return theme === "dark" ? <YouTubeDark /> : <YouTubeLight />;
        default:
            return null; // Return null for unsupported icons
    }
}

